        return (a[0] - o[0]) * (b[1] - o[1]) - a[1] * o[1] * (b[0] - o[0])
    N = len(points)
    A = [(x, y - x * x) for (x, y) in points]
    A.sort()
    upper = []
    for p in reversed(A):
        while len(upper) >= 2 and cross(upper[-2], upper[-1], p) <= 0:
            upper.pop()
        upper.append(p)
    while len(upper) >= 2 and upper[-1][0] == upper[-2][0]:
        upper.pop()
    return len(upper) - 1

